from tkinter import*root = Tk()root.title("PasswordGen")root.geometry("500x500")import randomarray = [[["1" , "2" , "3" , "4" , "5" , "6"] , ["Head" , "Tail"] , ["A" , "B" , "C" , "D" , "E" , "F"] , ["!" , "@" , "#" , "$" , "%" , "^"]]]entry1 = Entry(root)entry1.pack()label_guess = Label(root)label_guess.pack()label_new = Label(root)def genPassword():    password = entry1.get()    label_guess["text"] = "guessed password = " + password            change1 = random.randint(0 , 5)    change2 = random.randint(0 , 1)    change3 = random.randint(0 , 5)    change4 = random.randint(0 , 5)            f1 = array[0][0][change1]    f2 = array[0][1][change2]    f3 = array[0][2][change3]    f4 = array[0][3][change4]        new_password = str(f1) + str(f2) + str(f3) + str(f4)        label_new["text"] = "new password = " + new_password            button = Button(root , text = "Generate Password" , command = genPassword)button.place(relx = 0.5 , rely = 0.4 , anchor = CENTER)label_new.place(relx = 0.5 , rely = 0.5 , anchor = CENTER)root.mainloop()